    const onSubmit = ({id, password}) => {
        // const { id, password } = data;
        console.log(`${id}, ${password}`)
        setUserId(id);
        setUserPassword(password);
        console.log(`${userId}, ${userPassword}`)
    }
    return (
        <div>
            <Login onSubmit={onSubmit}/>
        </div>
    );
}

